// src/components/VendorManagement.js
import React from 'react';
import './VendorManagement.css';

const VendorManagement = () => {
    return (
        <div className="service-page">
            <h1>Vendor Management</h1>
            <p>
                Our team at WedSymphony has curated a list of trusted and experienced vendors for every aspect of your wedding. From florists to photographers, we manage all vendor relationships to ensure smooth and stress-free experiences for our clients.
            </p>
            <p>
                Services include:
                <ul>
                    <li>Vendor Selection and Recommendations</li>
                    <li>Contract Negotiations</li>
                    <li>Payment and Scheduling Coordination</li>
                    <li>Vendor Communication Management</li>
                    <li>On-Day Vendor Coordination</li>
                </ul>
            </p>
            <p>
                With our vendor management service, you can focus on enjoying your wedding day, knowing that all logistics are handled seamlessly.
            </p>
        </div>
    );
}

export default VendorManagement;
